import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Hero } from './components/Hero/Hero';  // パスの修正

// 仮のコンポーネント定義（まだ実装されていないコンポーネント用）
const Header = () => <header>Header</header>;
const Benefits = () => <div>Benefits</div>;
const TechStack = () => <div>TechStack</div>;
const Positions = () => <div>Positions</div>;
const Culture = () => <div>Culture</div>;
const Contact = () => <div>Contact</div>;

const App: React.FC = () => {
  return (
    <Router>
      <div className="app">
        <Header />
        <Routes>
          <Route path="/" element={
            <main>
              <Hero />
              <Benefits />
              <TechStack />
              <Positions />
              <Culture />
              <Contact />
            </main>
          } />
          <Route path="/positions" element={<Positions />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
